import { Link } from 'next/router'
import StatusDot from  '../shared/StatusDot'
export default function Users({usersData}) {
    const Card = ({user, id}) => {
        let uri = `/profile/${id}`
        return (
            <div className='w-40 pl-4 mt-4'>
                <Link href={uri}><img src={user.avatar} className='w-32 h-32 rounded-full shadow border-2 border-c1 border-opacity-75'/></Link>
                <div className="text-left w-24 mx-auto leading-tight">
                    <h3 className="text-lg font-f1">{user.first_name+' '+user.last_name}</h3>
                    <p className='text-xs font-f1 font-thin'>{user.role}</p>
                    <p className='text-xs font-f1 font-thin'>{user.city}</p>
                    <div className='font-thin text-xs font-c1 flex items-center'>
                        <p>Online</p>
                        <StatusDot color='green-400'/>
                    </div>
                </div>
            </div>
        )
    }
    const users = usersData ||
        Array(20).fill({
            first_name: 'First',
            last_name: 'Last',
            role: 'Project Lead',
            avatar: `http://place-puppy.com/200x300`,
            city: 'New York'
        }
    )

    const cards = users.map((user, i) => <Card user={user} id={i} />)
    const grid = `w-full overflow-x-scroll grid grid-cols-${users.length} col-gap-0 no-scrollbar grid-flow-col no-wrap`
    return(
        <div className={grid}>
            {cards}
        </div>
    )
}
